  return (
    <div className="App">
      <Router>
      <Navbar/>
       <Switch>
          <Route Path='/' exact component={Home}/>
          <Route Path='/Memo' exact component ={Memo}/>
          <Route Path= 'Games' exact component = {Games}/>
